function UserProfile(props) {
    return(
        <div className="w-full h-full" style={{width: "70%", marginLeft: '20%', marginTop: '5%', filter:'blur(5px)'}}>
            <img className="min-w-full min-h-full h-auto relative bottom-1/2 right-1/2 transform translate-x-1/2 translate-y-1/2" src={props.profile}/>
        </div>
    )
}

export default UserProfile;
